window.Thunder.components["checkout-success"].template=function(t){return'<div class="thunder--checkout-success"><h2>'+t.m(t.options.type+"Success")+"</h2><h3>"+t.m(t.options.type+"Info")+'</h3><table class="thunder--'+t.options.type+'-info"><tbody><tr><td>'+t.m(t.options.type+"Id")+"</td><td>"+t.subject._id+"</td></tr><tr><td>"+("order"===t.options.type?t.m("orderedAt"):t.m("subscribedAt"))+"</td><td>"+t.subject.createdAt.formatted+'</td></tr></tbody></table><div class="thunder--checkout-success-actions"><button class="thunder--button thunder--view-more-details">'+t.m("viewMoreDetails")+"</button></div></div>"};